import React from 'react'
import './App.css';
import InputValue from '../src/component/inputValue';
import History from '../src/component/history';
import { DataProvider } from '../src/Contexts/dataContext'
import Bar from './component/Bar'


function App() {
  return (
    <div className="App">
      <DataProvider>
        <h1>BMI Tracker</h1>
        <InputValue />
        <h2>History</h2>
        <History />
      </DataProvider>
    </div>
  );
}

export default App;
